import React from 'react';
import Post from '../Components/Post'
import styled from 'styled-components'
import Lorem from 'react-lorem-component'

const Feed = props => {

    const feed = props.data.map(post => 
        <Post 
            data={post} 
            mode={props.mode}
            paragraph={Lorem}
        />
    )

    return (
        <Container>
            {feed}
        </Container>
    );
}

const Container = styled.div`
    display: flex;
    flex-wrap: wrap;
    max-width: 992px;
`

export default Feed;
